// Add your JavaScript code here
let prevText = ""
let currentText = "";
const textContainer = document.getElementById("text-container");
const dynamicText = document.getElementById("dynamic-text");
let selectedNode = null;
let indexes = { start: null, end: null }

let drag = false;

document.addEventListener('mousedown', () => drag = false);
document.addEventListener('mousemove', () => drag = true);
document.addEventListener('mouseup', () => {
    if (drag) {
        copyText()
    }
});

function copyText() {
    if (document.getElementById("response-box") && window.getSelection().toString()?.trim()) {
        if (prevText)
            selectedNode.innerHTML = prevText;
        prevText = ""
    }
    if (document.getElementById("highlighted-id-text")) {
        closeModal()
    }
    const selectedText = getSelectedText();
    if (selectedText) {
        currentText = selectedText
        highlightSelectedText(selectedText);
        requestGPTResponse();
    }
};

function getSelectedText() {
    const selectedText = window.getSelection().toString();
    selectedNode = document.getSelection().focusNode.parentElement;
    if (selectedText?.trim()) {
        if (selectedNode?.innerHTML?.startsWith('<span id="highlighted-id-text"')) {
            indexes.start += document.getSelection().getRangeAt(0).startOffset
            indexes.end += document.getSelection().getRangeAt(0).endOffset

        }
        else {

            indexes.start = document.getSelection().getRangeAt(0).startOffset
            indexes.end = document.getSelection().getRangeAt(0).endOffset
        }
    }
    return selectedText.trim();
}

function highlightSelectedText(selectedText) {
    prevText = selectedNode.innerText;
    const text = selectedNode.innerText;
    const highlightedText = text.replaceAll(selectedText,
        `<span id="highlighted-id-text" class="highlighted"><span>${selectedText}</span></span>`)
    selectedNode.innerHTML = highlightedText;
    if (!document.getElementById("cognify-main-container")) {

        document.body.innerHTML += `<div id="cognify-main-container" class=""><div id="response-box" class="hide">
        <div class="response-box-header">
        <img src="data:image/png;base64," alt="cognify-logo" />
        <div id="cognify-popup-close" class="close-icon">x</div>
        </div>
        <div class="cognify-content">
        <div class="search-text" id="search-text">Searching: <u>${selectedText}</u></div>
        <label class="choose-option">Choose an option
        <select id="choose-option" name="action">
        <option value="Summarize">Summarize</option>
        <option value="Insight Analysis">Insight Analysis</option>
        <option value="Simplest Explanation">Simplest Explanation</option>
        <option value="Detect Tone">Detect Tone</option>
        <option value="Define Word">Define Word</option>
        </select>
        </label>
        <div id="cognify-result"></div>
        </div>
        </div>
        </div>`
        document.getElementById("cognify-main-container").addEventListener('click', function () {
            document.getElementById("response-box").className = document.getElementById("response-box").className === 'hide' ? "" : "hide";

        })
        document.getElementById("response-box").addEventListener('click', function (event) {
            event.stopPropagation();
        })
        document.getElementById("cognify-popup-close").addEventListener('click', function (event) {
            event.stopPropagation();
            document.getElementById("response-box").className = ' hide'
        })
        // <div id="backdrop-grammerly"></div>
        const elem = document.getElementById('highlighted-id-text')
        if (elem && document.getElementById("response-box")) {
            document.getElementById("choose-option").addEventListener('change', function (event) {
                event.stopPropagation();
                event.preventDefault();
                event.stopImmediatePropagation();
                requestGPTResponse(event.target.value)
            })
            document.getElementById("choose-option").addEventListener('mouseup', function (event) {
                event.stopImmediatePropagation();
                event.stopPropagation();
                event.preventDefault()
            })
        }
    }
    else {
        document.getElementById("search-text").innerHTML = `Searching: <u>${selectedText}</u>`
    }
}
function closeModal() {
    selectedNode.innerHTML = prevText;
    prevText = ""
    selectedNode = null
}

function requestGPTResponse(action = "Simplest Explanation") {
    if (document.getElementById("response-box")) {
        document.getElementById("choose-option").value = action
        const responseBox = document.getElementById("cognify-result");
        responseBox.innerHTML = '<div class="loading">Loading...</div>'
        const data = new FormData()
        data.append('text', currentText)
        data.append('action', action)
        fetch("https://mycognify-8238d01b7979.herokuapp.com/analyze", { method: "post", body: data }).then(res => {
            if (!res.ok) {
                throw new Error('Network error');
            }
            return res.json()
        }).then((res) => {

            // You can send the selectedText to your server for GPT response or use an API here.
            // For demonstration, we'll just display it in the response box.
            if (document.getElementById("cognify-result")) {

                responseBox.innerHTML = `<span class='inner-response'>${res?.output}</span> `;
            }
        }).catch((err) => {
            responseBox.innerHTML = `<span class='inner-response'>
            <span class="response-error">${err.message}</span>
            </span> `;
        })
    }
}